import React, {useState} from 'react';

const App = () => {
  const [count,setCount] = useState(0);

  const increment = () => setCount(count + 1);

  return (
    <div>
      <div>count:{count}</div>
      <button onClick={increment}>+1</button>
    </div>
  );
}

export default App;
